import s from './Messages.module.css';

const Messages = (props) => {
    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItem}>
                <div className={s.dialog}>NikArt</div>
                <div className={s.dialog}>Andrey</div>
                <div className={s.dialog}>Anya</div>
                <div className={s.dialog}>Mama</div>
            </div>
            <div className={s.messages}>
                <div className={s.message}>Hi</div>
                <div className={s.message}>Good</div>
                <div className={s.message}>All right</div>
                <div className={s.message}>Welcome</div>
            </div>
        </div>
    )
}

export default Messages;
